My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Upozornenie: Časti tejto aplikácie sú určené pre zdravotníckych pracovníkov ako nástroj na podporu rozhodovania. Nie je určená na používanie pacientmi a nenahrádza rady lekára.

Mediately Mediately Databáza Liekov — Mobilný asistent pre rýchlejšiu diagnostiku a liečbu, odteraz aj na vašom iPhone a iPade.

Vďaka aplikácii môžete jednoducho vyhľadávať v offline registri liekov s viac ako 9.600 liekmi a získať okamžitý prístup k interaktívnym klinickým nástrojom a dávkovacím kalkulačkám.

1. Získajte informácie o viac ako 9.600 liekoch

Pri každom lieku si môžete zobraziť podrobné informácie vrátane:

• Základných informácií o lieku (účinná látka, zloženie, lieková forma, trieda, informácie o úhrade lieku zo systému verejného zdravotného poistenia);
• Dôležitých informácií z dokumentu SmPC pre daný liek (indikácie, dávkovanie, kontraindikácie, interakcie, vedľajšie účinky, predávkovanie atď.);
• Klasifikácie ATC a paralelné lieky;
• Balenia a ceny;
• Prístupu ku kompletnému dokumentu SmPC vo formáte PDF (vyžaduje pripojenie na internet).

2. Vyhľadávajte v rozsiahlej ponuke interaktívnych diagnostických nástrojov

Okrem kompletnej databázy liekov aplikácia obsahuje množstvo interaktívnych klinických nástrojov a dávkovacích kalkulačiek užitočných v každodennej praxi:

• CHA2DS2-VASc (Score for Atrial Fibrillation Stroke Risk, skórovací systém pre stratifikáciu rizika CMP u pacientov s fibriláciou predsiení);
• GCS (Glasgow Coma Scale, škála hodnotiaca kvantitatívnu poruchu vedomia u dospelých);
• GFR (odhad glomerulárnej filtrácie podľa rovnice MDRD);
• HAS-BLED (skórovací systém na stanovenie rizika závažného krvácania u pacientov s fibriláciou predsiení);
• MELD (Model for End-Stage Liver Disease, skórovací systém používaný na hodnotenie závažnosti chronických ochorení pečene);
• PERC skóre (Pulmonary Embolism Rule-out Criteria, skórovací systém kritérií pre vylúčenie pľúcnej embólie);
• Wellsove kritériá pre pľúcnu embóliu.

Objavte nástroje, ktoré denne používajú tisíce lekárov.

3. CME (Vzdelávanie)

Prehĺbte svoje vedomosti a získajte kredity CME z pohodlia vášho domova alebo kancelárie.

• Prečítajte si článok alebo si pozrite video, ktoré vás zaujme.
• Prehľad tém je neustále aktualizovaný, aby ste získali užitočné poznatky z vášho odboru.

Aplikácia obsahuje aj klasifikáciu chorôb podľa MKCH-10 a klasifikačný systém ATC. Pravidelne ju aktualizujeme, aby ste mali vždy k dispozícii najnovšie informácie.

Táto aplikácia je registrovaná a regulovaná slovinským Úradom pre kontrolu liečiv a zdravotníckych pomôcok a je označená značkou CE ako zdravotnícka pomôcka. Spoločnosť Modra Jagoda d.o.o. je držiteľom certifikátu ISO 13485 certifikácie systému managementu kvality zdravotníckych pomôcok.

Poznámka: Části této aplikace jsou určeny pro zdravotnické pracovníky jako nástroj pro podporu rozhodování. Není určen pro pacienty a nenahrazuje doporučení lékaře.

Mediately Databáze Léčiv — Mobilní asistent pro rychlejší diagnostiku a léčbu, nyní ve Vašem iPhonu a iPadu. 

S aplikací můžete snadno vyhledávat v offline registru léčiv s více než 10.000 léky a mít bezprostřední přístup k interaktivním klinickým nástrojům a dávkovacím kalkulátorům. 

1. Získejte informace o více než 10.000 lécích. 

U každého léku si můžete zobrazit podrobné tyto informace:	

• Základní informace o léku (účinná látka, složení, léková forma, třída, informace o úhradě léku ze systému veřejného zdravotního pojištění);
• Důležité informace ze Souhrnu údajů o přípravku (SPC) (indikace, dávkování, kontraindikace, interakce, vedlejší účinky, předávkování atd.);
• ATC klasifikace a podobné léky;
• Balení a ceny;
• Přístup k plné verzi SPC v PDF formátu (nutné internetové připojení).

2. Vyhledávejte v široké nabídce interaktivních diagnostických nástrojů. 

Spolu s kompletní databází léků aplikace obsahuje řadu interaktivních klinických nástrojů a dávkovacích kalkulátorů, které využijete ve vaší každodenní praxi:

• CHA2DS2-VASc (Score for Atrial Fibrillation Stroke Risk, skórovací systém pro stratifikaci rizika CMP u pacientů s fibrilací síní);
• GCS (Glasgow Coma Scale, škála hodnotící kvantitativní poruchu vědomí u dospělých);
• GFR (odhad glomerulární filtrace podle rovnice MDRD);
• HAS-BLED (skórovací systém pro stanovení rizika závažného krvácení u pacientů s fibrilací síní);
• MELD (Model for End-Stage Liver Disease, skórovací systém používaný k hodnocení závažnosti chronických onemocnění jater);
• PERC skóre (Pulmonary Embolism Rule-out Criteria, skórovací systém kritérií pro vyloučení plicní embolie);
• Wellsova kritéria pro plicní embolii.

Objevte nástroje, které každý den používají tisíce lékařů.

3. CME (Continuous Medical Education, celoživotní vzdělávání lékařů) 

Zlepšete své znalosti a získejte kredity CME z pohodlí domova nebo kanceláře.

• Přečtěte si článek nebo se podívejte na video, které vás zajímá.
• Témata jsou neustále aktualizována, aby vám přinášela užitečné poznatky z vašeho oboru.

V aplikaci také najdete mezinárodní klasifikaci nemocí MKN-10 a ATC klasifikaci léčiv. Tyto klasifikace pravidelně aktualizujeme, takže nejnovější informace máte vždy s sebou.

Tato aplikace je registrována a regulována Slovinským regulačním úřadem pro léčivé přípravky a zdravotnické prostředky a je označena CE značkou shody jako zdravotnický prostředek. Modra Jagoda d.o.o. je držitelem ISO 13485 certifikace systému managementu kvality zdravotnických prostředků.

Listening device - Hearing aid will automatically adjust to specific features of your hearing.
Use the power of your smartphone and latest technologies for maximum sound amplification. 
You only need a simple headset in order to use it. 

FEATURES:
-- Automatic adjustment to hearing specifics - FREE;
-- Hearing correction for each ear - FREE;
-- Adaptation to different types of environment - FREE;
-- Full acoustic amplification up to 30 dB with a wired headset - FREE;
-- Built-in hearing test - FREE;
-- Amplification of quiet sounds without losing the overall volume (dynamic compression) - FREE;
-- Using 3 different options of sound amplification - FREE;
-- You will hear sounds and noises that you have not heard before, some familiar sounds can acquire with metallic aftersound, which can cause temporary discomfort. Use the built-in noise reduction function - FREE;
-- Support of Bluetooth headsets and Air Pods* - FREE.
-- Compatibility with HealthKit - your audiogram will be stored/read in -- HealthKit to enable you to control your hearing changes and will allow to provide you with customized hearing enhancement - FREE.

ADDITIONAL FEATURES:
-- Using a smartphone as a remote microphone while using Bluetooth headset for watching TV, etc. – TRIAL;
-- “Super Boost” - powerful sound amplification – TRIAL;
-- Ability to create an unlimited number of profiles for different sound situations – TRIAL;
-- Regulated noise suppression – eliminates background noise, increases speech intelligibility – TRIAL;
-- Audio recorder/Dictaphone with amplification and personalization of sound to your hearing – TRIAL.

